import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner scanner = new Scanner(System.in);
        System.out.println("Enter a string:");
        String input = scanner.nextLine();
        System.out.println("Enter a character:");
        char c = scanner.next().charAt(0);
        int count = 0;
        for (int i = 0; i < input.length(); i++) {
            if (input.charAt(i) == c) {
                count++;
            }
        }
        System.out.println("The character '" + c + "' appears " + count + " times in the string.");
    }
}
```

### Explanation

* The program starts by importing the `java.util.Scanner` class, which is used to get user input.
* It then creates a `Scanner` object called `scanner` to read the user's input.
* The program prompts the user to enter a string and a character, and stores the input in the `input` variable and the `c` variable, respectively.
* It then uses a `for` loop to iterate over each character in the input string, and checks if the current character is equal to the character entered by the user. If it is, it increments the `count` variable.
* Finally, it prints out the number of times the character appears in the string.

### Example Use Cases

* Counting the number of occurrences of a specific letter in a word or phrase.
* Checking the frequency of a particular character in a text file or document.
* Validating user input by checking if a certain character appears a certain number of times in a string.

### Step-by-Step Solution

1. Create a new Java project in your preferred IDE.
2. Import the `java.util.Scanner` class.
3. Create a `Scanner` object to read user input.
4. Prompt the user to enter a string and a character.
5. Store the user's input in variables.
6. Use a `for` loop to iterate over each character in the input string.
7. Check if the current character is equal to the character entered by the user.
8. Increment a counter variable if the characters match.
9. Print out the number of times the character appears in the string.

